import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
  <>
    <ul>
      <li>Pawan</li>
      <li>is</li>
      <li>A</li>
      <li>Go</li>
    </ul>
  </>,
  document.getElementById("root")
);
